import { createBrowserRoute, RouterProvider } from "react-router-dom";
import MainPage from "./mainPage";

const routes = createBrowserRoute([{ path: "/", element: <MainPage /> }]);

function App() {
  return <RouterProvider router={routes} />;
}

export default App;
